fields:
- description: The date when telemetry data was received and processed on the 
    server side, derived from DATE(submission_timestamp) and used as the 
    partitioning key for daily aggregations
  mode: NULLABLE
  name: submission_date
  type: DATE
- description: A unique UUID identifier for each Firefox client installation, 
    used as the primary grouping key for aggregating multiple telemetry pings 
    per client per day
  mode: NULLABLE
  name: client_id
  type: STRING
- description: Total count of content process abnormal aborts for the day, 
    aggregated from subprocess_abnormal_abort keyed histogram with 'content' key
    across all pings
  mode: NULLABLE
  name: aborts_content_sum
  type: INTEGER
- description: Total count of GeckoMediaPlugin (GMP) process abnormal aborts for
    the day, aggregated from subprocess_abnormal_abort keyed histogram with 
    'gmplugin' key
  mode: NULLABLE
  name: aborts_gmplugin_sum
  type: INTEGER
- description: Total count of plugin process abnormal aborts for the day, 
    aggregated from subprocess_abnormal_abort keyed histogram with 'plugin' key
  mode: NULLABLE
  name: aborts_plugin_sum
  type: INTEGER
- description: Average number of active add-ons/extensions installed during the 
    day, computed from the length of environment.addons.active_addons array
  mode: NULLABLE
  name: active_addons_count_mean
  type: FLOAT
- description: Array of active browser extensions and add-ons with detailed 
