- description: Deprecated field previously used to track the active experiment 
    identifier; now always returns NULL
  mode: NULLABLE
  name: active_experiment_id
  type: STRING
- description: 'Total active browsing hours for the day, calculated by converting
    active_ticks (5-second intervals) to hours using formula: SUM(active_ticks / (3600/5))'
  mode: NULLABLE
  name: active_hours_sum
  type: FLOAT
- description: Boolean indicating whether add-on compatibility checking is 
    enabled in Firefox settings, determined using mode_last aggregation from 
    environment.settings
  mode: NULLABLE
  name: addon_compatibility_check_enabled
  type: BOOLEAN
- description: Build identifier string (e.g., '20191122153857') for the Firefox 
    application, representing the timestamp when the build was compiled, 
    selected using mode_last aggregation
  mode: NULLABLE
  name: app_build_id
  type: STRING
- description: User-visible version string (e.g., '1.0.3', '70.0.1') for the 
    Firefox browser shown in the UI, selected using mode_last aggregation from 
    application.display_version
  mode: NULLABLE
  name: app_display_version
  type: STRING
- description: Name of the Mozilla application (typically 'Firefox'), selected 
    using mode_last aggregation from application.name
  mode: NULLABLE
  name: app_name
  type: STRING
