    application, selected using mode_last aggregation from application.version
  mode: NULLABLE
  name: app_version
  type: STRING
- description: Structured data containing marketing attribution parameters 
    including source, medium, campaign, content, experiment, variation, dltoken,
    dlsource, and user agent (ua) from the download and installation, selected 
    using JSON mode_last aggregation
