  type: RECORD
- description: Boolean flag indicating whether the add-on blocklist feature is 
    enabled to prevent installation of malicious or problematic add-ons, 
    selected using mode_last aggregation
  mode: NULLABLE
  name: blocklist_enabled
  type: BOOLEAN
- description: The update channel for the Firefox application (e.g., 'release', 
    'beta', 'nightly', 'esr'), extracted from metadata.uri.app_update_channel 
    and selected using mode_last aggregation
  mode: NULLABLE
  name: channel
  type: STRING
- description: Average time difference in seconds between the client's system 
    clock and server time, calculated using TIMESTAMP_DIFF between 
    submission_timestamp and metadata.header.date
  mode: NULLABLE
  name: client_clock_skew_mean
  type: FLOAT
- description: Average delay in seconds between when the ping was created on the
    client and when it was received by the server, calculated using 
    TIMESTAMP_DIFF between submission_timestamp and creation_date
  mode: NULLABLE
  name: client_submission_latency_mean
  type: FLOAT
- description: Number of physical CPU cores on the client's device, selected 
    using mode_last aggregation from environment.system.cpu.cores
  mode: NULLABLE
  name: cpu_cores
  type: INTEGER
- description: Total number of logical CPU processors (including hyperthreading)
    on the client's device, selected using mode_last aggregation from 
    environment.system.cpu.count
  mode: NULLABLE
  name: cpu_count
  type: INTEGER
- description: CPU family identifier number as reported by the processor, 
    selected using mode_last aggregation from environment.system.cpu.family
  mode: NULLABLE
  name: cpu_family
  type: INTEGER
- description: Size of the Level 2 CPU cache in kilobytes, selected using 
    mode_last aggregation from environment.system.cpu.l2cache_kb
  mode: NULLABLE
  name: cpu_l2_cache_kb
  type: INTEGER
- description: Size of the Level 3 CPU cache in kilobytes, selected using 
    mode_last aggregation from environment.system.cpu.l3cache_kb
  mode: NULLABLE
  name: cpu_l3_cache_kb
  type: INTEGER
- description: CPU model identifier number as reported by the processor, 
    selected using mode_last aggregation from environment.system.cpu.model
  mode: NULLABLE
  name: cpu_model
  type: INTEGER
- description: Processor clock speed in megahertz (MHz), selected using 
    mode_last aggregation from environment.system.cpu.speed_m_hz
  mode: NULLABLE
  name: cpu_speed_mhz
  type: INTEGER
- description: CPU stepping revision number indicating minor processor 
    revisions, selected using mode_last aggregation from 
    environment.system.cpu.stepping
  mode: NULLABLE
  name: cpu_stepping
  type: INTEGER
- description: CPU manufacturer name (e.g., 'GenuineIntel', 'AuthenticAMD'), 
    selected using mode_last aggregation from environment.system.cpu.vendor
  mode: NULLABLE
  name: cpu_vendor
  type: STRING
- description: Total count of detected content process crashes with dump files 
    for the day, aggregated from subprocess_crashes_with_dump keyed histogram 
    with 'content' key
  mode: NULLABLE
  name: crashes_detected_content_sum
  type: INTEGER
- description: Total count of detected GeckoMediaPlugin process crashes with 
    dump files for the day, aggregated from subprocess_crashes_with_dump keyed 
