  mode: NULLABLE
  name: crashes_detected_gmplugin_sum
  type: INTEGER
- description: Total count of detected plugin process crashes with dump files 
    for the day, aggregated from subprocess_crashes_with_dump keyed histogram 
    with 'plugin' key
  mode: NULLABLE
  name: crashes_detected_plugin_sum
  type: INTEGER
- description: Total number of attempts to submit content process crash reports 
    to Mozilla servers, aggregated from process_crash_submit_attempt keyed 
    histogram with 'content-crash' key
  mode: NULLABLE
  name: crash_submit_attempt_content_sum
  type: INTEGER
- description: Total number of attempts to submit main process crash reports to 
    Mozilla servers, aggregated from process_crash_submit_attempt keyed 
