  mode: NULLABLE
  name: crash_submit_attempt_main_sum
  type: INTEGER
- description: Total number of attempts to submit plugin process crash reports 
    to Mozilla servers, aggregated from process_crash_submit_attempt keyed 
    histogram with 'plugin-crash' key
  mode: NULLABLE
  name: crash_submit_attempt_plugin_sum
  type: INTEGER
- description: Total number of successful content process crash report 
    submissions to Mozilla servers, aggregated from process_crash_submit_success
    keyed histogram with 'content-crash' key
  mode: NULLABLE
  name: crash_submit_success_content_sum
  type: INTEGER
- description: Total number of successful main process crash report submissions 
    to Mozilla servers, aggregated from process_crash_submit_success keyed 
    histogram with 'main-crash' key
  mode: NULLABLE
  name: crash_submit_success_main_sum
  type: INTEGER
- description: Total number of successful plugin process crash report 
    submissions to Mozilla servers, aggregated from process_crash_submit_success
    keyed histogram with 'plugin-crash' key
  mode: NULLABLE
  name: crash_submit_success_plugin_sum
  type: INTEGER
- description: User-visible name of the default search engine (e.g., 'Google', 
    'DuckDuckGo'), selected using mode_last aggregation from 
